import React from 'react';
import PropTypes from 'prop-types';
import { Col, List, Row } from 'antd';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	console.log(current);

	return (
		<List
			grid={{ gutter: 16, column: 1 }}
			size='small'
			dataSource={current}
			renderItem={(item) => (
				<List.Item>
					<p>{item.title}</p>
				</List.Item>
			)}
		/>
	);
}

export default ListViewTest;
